import React from "react";

import Layout from "../components/layout";

class Index extends React.Component {
    state = { }

    render() {
        return (
            <Layout>
                <div style={{
                    background: 'url("/static/images/bridge.png")',
                    backgroundSize: 'cover',
                    height: '40vh',
                    backgroundPosition: 'center',
                }}></div>
            </Layout>
        );
    }
}

export default Index;
